import React from 'react';
// import data from '~/Dev/WWTF/data/sffilmdata.csv';
// import MapContainer from './MapContainer.js';
const APItitle = '/AllTitles/'

class AllTitlesList extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			titles: [],
			sortedTitles: []
		}
	  }

	loadTitles(){
		console.log("Calling: ", window.apiCall)
		fetch (window.apiCall)
			.then(res => res.json())
			.then(result => {
				this.setState({titles:result})
				console.log("🎄", result)
				this.setState({sortedTitles: this.generateUniqueTitles(result)})
			})
			.catch(err => console.log('❗️ Check All Titles Component',err))
	}

	componentWillMount() {
		this.loadTitles();
	}

	generateUniqueTitles(titleList){
		var uniqueTitles = {}
		titleList.forEach(film => {
			if (uniqueTitles[film.titles] === undefined){
				uniqueTitles[film.titles] = true
			}
		})

		let sortedTitles = Object.keys(uniqueTitles).sort()
		return sortedTitles
	}

	render(){
		let lis = this.state.sortedTitles.map(title => {
			return <li key={title.id}>{title.title}</li>
		})

		return (
			<div className="App-Component-Titles-Route-Container">
			<h1>Tour By Title</h1>

				<ol>
					{lis}
				</ol>
			</div>
		)
	}
}


export default AllTitlesList;
